const router = require('express').Router();
let Trip = commonUtil.getModel('trip');
const RegVehicle = promise.promisifyAll(commonUtil.getModel('registeredVehicle'));
const Driver = promise.promisifyAll(commonUtil.getModel('driver'));
const VehicleDriverAssoc = promise.promisifyAll(commonUtil.getModel('vehicleDriverAssociation'));
let ReportExelService = promise.promisifyAll(commonUtil.getService('reportExel'));

let allowedSearchFields = ["_id","vehicle","driver", "driver2", "disassociated","clientId",	"ass_remark", "disass_remark", "from", "to"];

function prepareFilter(query) {
	let fFilter = {};
	for (let i in query) {
		if (otherUtil.isAllowedFilter (i, allowedSearchFields)) {
			if (i === 'from') {
				if (query['disassociated'] === "true") {
					let startDate = new Date(query[i]);
					startDate.setSeconds(0);
					startDate.setHours(0);
					startDate.setMinutes(0);
					fFilter["disass_date"] = fFilter["disass_date"] || {};
					fFilter["disass_date"].$gte = startDate;
				}
				else if (query['disassociated'] === "false") {
					let startDate = new Date(query[i]);
					startDate.setSeconds(0);
					startDate.setHours(0);
					startDate.setMinutes(0);
					fFilter["ass_date"] = fFilter["ass_date"] || {};
					fFilter["ass_date"].$gte = startDate;
				}
			}
			else if (i === 'to') {
				if (query['disassociated'] === "true") {
					let endDate = new Date(query[i]);
					endDate.setSeconds(59);
					endDate.setHours(23);
					endDate.setMinutes(59);
					fFilter["disass_date"] = fFilter["disass_date"] || {};
					fFilter["disass_date"].$lte = endDate;
				}
				else if (query['disassociated'] === "true") {
					let endDate = new Date(query[i]);
					endDate.setSeconds(59);
					endDate.setHours(23);
					endDate.setMinutes(59);
					fFilter["ass_date"] = fFilter["ass_date"] || {};
					fFilter["ass_date"].$lte = endDate;
				}
			}

			else if(i === "disassociated"){
				fFilter[i] = (query[i] === "true");
			}
			else if(i === "ass_remark" || i === "disass_remark"){
				fFilter[i] = {$regex:query[i],$options:'-i'};
			}
			else if (i === 'vehicle') {
				fFilter[i] = {$in: otherUtil.arrString2ObjectId([query[i]])}
			}
			else if (i === 'driver') {
				fFilter[i] = {$in: otherUtil.arrString2ObjectId([query[i]])}
			}
			else if (i === 'driver2') {
				fFilter[i] = {$in: otherUtil.arrString2ObjectId([query[i]])}
			}
			else {
				fFilter[i] = query[i];
			}
		}
	}
	return fFilter;
}

router.get('/get',function (req, res, next) {
	req.query.queryFilter = prepareFilter(req.query);
	if(req.query.download){
		req.query.no_of_docs = 500;
		// req.query.ass_date = req.query.queryFilter.ass_date;
	}

	if(req.query.sort)
		req.query.sort = {ass_date:req.query.sort};
	else
		req.query.sort = {ass_date:-1};

	otherUtil.findPagination(VehicleDriverAssoc,req.query,function (err, data) {
		if(err){
			return next(err);
		}
		else if(req.query.download) {
				ReportExelService.driverVehicleAssoc(data.data, req, function (data) {
					return res.status(200).json({
						"status": "OK",
						"message": "report download available.",
						"url": data.url
					});
				});
		}else {
			return res.status (200).json ({
				"status": "OK",
				"message": "Data found",
				"data": data
			});
		}
	})
});

router.post('/getV2', async function (req, res, next) {

	try{
        let body = req.body;

		if(!body.download)
			body.no_of_docs = body.no_of_docs || 10;
		else
			body.no_of_docs	= 1000;

		if(!body.sort)
			body.sort = {ass_date:-1};

		let oFilter = {};
		oFilter.clientId = req.user.clientId;

		if(req.body.vehicle)
			oFilter.vehicle = {$in: otherUtil.arrString2ObjectId([req.body.vehicle])}

		if(req.body.date){
			oFilter['$or'] = [
				{$and:[{ass_date: {$lte: new Date(req.body.date)}},{disassociated: false}]},
				{$and:[{ass_date: {$lte: new Date(req.body.date)}},{disass_date: {$gte: new Date(req.body.date)}}]},
			]
		}

		body.skip = body.skip || 1;
		body.populate = body.populate || [];

		const associationQuery = [
			{ $match: oFilter },

			{ $sort: body.sort || {_id: -1} },
			{ $skip: (body.no_of_docs * body.skip) - body.no_of_docs },
			{ $limit: body.no_of_docs },
			{
				$lookup: {
					from: 'drivers',
					localField: 'driver',
					foreignField: '_id',
					as: 'driver'
				}
			},
			{
				$unwind: {
					path: '$driver',
					preserveNullAndEmptyArrays: true
				}
			},
			{
				$lookup: {
					from: 'registeredvehicles',
					localField: 'vehicle',
					foreignField: '_id',
					as: 'vehicle'
				}
			},
			{$unwind: {
					path: '$vehicle',
					preserveNullAndEmptyArrays: true
				}},
			{$project: {vehicle: {_id: '$vehicle._id', vehicle_reg_no: "$vehicle.vehicle_reg_no"}, driver:{_id: '$driver._id',name: '$driver.name'},ass_date:1, disass_date:1, ass_remark:1, disass_remark:1 }
			}
		];

		const associationData = await VehicleDriverAssoc
			.aggregate(associationQuery)
			.allowDiskUse(true);

		return res.status (200).json ({
			"status": "OK",
			"message": "Vehicle Driver Associated Found",
			"data": associationData
		});

	}catch (e) {
		console.log(e);
		throw e;
	}

});


router.post('/associate',async function (req,res) {
	if (otherUtil.isEmptyObject(req.body)){
		return res.status(500).json({"status":"ERROR","message":"No body found"});
	}
	if (!req.body.vehicle || !req.body.driver){
		return res.status(500).json({"status":"ERROR","message":"Invalid request"});
	}
	try {
		let fromAdv = req.body.fromAdv;
		let vehicle = await RegVehicle.find ({clientId: req.user.clientId, _id: req.body.vehicle});
		if (!vehicle || !(vehicle = vehicle[0])) {
			return res.status (500).json ({"status": "ERROR", "message": "Vehicle not found!"});
		}
		let driver = await Driver.find ({clientId: req.user.clientId, _id: req.body.driver, populateVehicle: true});
		if (!driver || !(driver = driver[0])) {
			return res.status (500).json ({"status": "ERROR", "message": "Driver not found!"});
		}
		let preAssoVehicle = await VehicleDriverAssoc.find({
			clientId: req.user.clientId,
			disassociated:false,
			driver2:{$exists:false},
			vehicle:req.body.vehicle}).lean();
		let preAssoDriver = await VehicleDriverAssoc.find({
			clientId: req.user.clientId,
			disassociated:false,
			driver2:{$exists:false},
			driver:req.body.driver}).lean();
		let preAssoDriver2 = await VehicleDriverAssoc.find({
			clientId: req.user.clientId,
			disassociated:false,
			driver:{$exists:false},
			driver2:req.body.driver}).lean();
		if(preAssoVehicle && preAssoVehicle[0]){
			return res.status (200).json ({
				"status": "ERROR",
				"message": `${preAssoVehicle[0].driver.name } is already on ${preAssoVehicle[0].vehicle && preAssoVehicle[0].vehicle.vehicle_reg_no
				}!Please disassociate before association!`,
				"data": {}
			});
		}
		else if(preAssoVehicle && preAssoVehicle[0] || preAssoDriver && preAssoDriver[0] || preAssoDriver2 && preAssoDriver2[0]){
			return res.status (200).json ({
				"status": "ERROR",
				"message": `${preAssoDriver[0] && preAssoDriver[0].driver ? preAssoDriver[0].driver.name : preAssoDriver2[0].driver2.name } is already on ${preAssoDriver && preAssoDriver[0] ? preAssoDriver[0].vehicle && preAssoDriver[0].vehicle.vehicle_reg_no :
					preAssoDriver2[0].vehicle && preAssoDriver2[0].vehicle.vehicle_reg_no
				}!Please disassociate before association!`,
				"data": {}
			});
		}
  // update driver on vehicle from trip advance page
		let postAssoVehicle = await VehicleDriverAssoc.find({
			clientId: req.user.clientId,
			driver2:{$exists:false},
			vehicle: req.body.vehicle,
			$or:[{ass_date: {$gte: new Date(req.body.ass_date)}},{disass_date: {$gte: new Date(req.body.ass_date)}}]
		},{_id: 1}).lean();
		let postAssoDriver = await VehicleDriverAssoc.find({
			clientId: req.user.clientId,
			driver2:{$exists:false},
			driver: req.body.driver,
			$or:[{ass_date: {$gte: new Date(req.body.ass_date)}},{disass_date: {$gte: new Date(req.body.ass_date)}}]
		},{_id: 1}).lean();
		let postAssoDriver2 = await VehicleDriverAssoc.find({
			clientId: req.user.clientId,
			driver:{$exists:false},
			driver2:req.body.driver,
			$or:[{ass_date: {$gte: new Date(req.body.ass_date)}},{disass_date: {$gte: new Date(req.body.ass_date)}}]
		},{_id: 1}).lean();
		if(postAssoVehicle && postAssoVehicle.length || postAssoDriver && postAssoDriver.length || postAssoDriver2 && postAssoDriver2.length && fromAdv){
			return res.status (200).json ({
				"status": "ERROR",
				"message": "Can not Associate Driver on Vehicle in Past From Here",
				"data": {}
			});
		}

		let data2save = new VehicleDriverAssoc ({
			"clientId": req.user.clientId,
			"vehicle": vehicle._id,
			"driver": driver._id,
			"ass_date": req.body.ass_date,
			"ass_remark": req.body.ass_remark,
			"ass_gps_odo": vehicle.odometer,
			"ass_veh_odo": req.body.ass_veh_odo,
			"ass_by": req.user._id
		});
		let savedData = await data2save.save();
		if (savedData) {
			await RegVehicle.update({clientId: req.user.clientId, _id: req.body.vehicle},
				{$set:{
					driver_name:driver.name,
					driver_employee_code:driver.employee_code,
					driver: driver._id,
					driver_contact_no: driver.prim_contact_no,
					driver_license: driver.license_no
				}});
			await Driver.update({clientId: req.user.clientId, _id: req.body.driver},{
				$set: {
					vehicle_assigned_reg_name: vehicle.vehicle_reg_no,
					vehicle_assigned: vehicle._id
				}
			});

		}
// update driver on vehicle from trip advance page also update all trips which lie in given date range
		if(savedData && fromAdv) {
			let aFoundTrip = await Trip.find({
				'clientId': req.body.clientId,
				'vehicle': vehicle._id,
				'advSettled.isCompletelySettled': false,
				'payments.0': {$exists: false},
				'statuses': {
					$elemMatch: {
						'status': 'Trip started',
						'date': {
							$gte: new Date(req.body.ass_date)
						}
					}
				}
			}, {_id: 1}).lean();

			if (aFoundTrip && aFoundTrip.length) {
				await Trip.updateMany({
					'_id': {$in: otherUtil.arrString2ObjectId(aFoundTrip.map(o => o._id))},
					'clientId': req.body.clientId,
				}, {
					driver: driver._id
				});
			}
		}

		return res.status (200).json ({
			"status": "OK",
			"message": "Vehicle Driver Associated",
			"data": savedData
		});

	}catch (e){
		return res.status (500).json ({
			"status": "ERROR",
			"message": e.toString()
		});
	}
});

