router.post('/backDateassociate',async function (req,res) {
	if (otherUtil.isEmptyObject(req.body)){
		return res.status(500).json({"status":"ERROR","message":"No body found"});
	}
	if (!req.body.vehicle || !req.body.driver || !req.body.ass_date || !req.body.disass_date){
		return res.status(500).json({"status":"ERROR","message":"Invalid request"});
	}
	try {
		let vehicle = await RegVehicle.find ({clientId: req.user.clientId,
			_id: otherUtil.arrString2ObjectId(req.body.vehicle)});
		if (!vehicle || !(vehicle = vehicle[0])) {
			return res.status (500).json ({"status": "ERROR", "message": "Vehicle not found!"});
		}
		let driver = await Driver.find ({clientId: req.user.clientId, _id:
			otherUtil.arrString2ObjectId(req.body.driver)});
		if (!driver || !(driver = driver[0])) {
			return res.status (500).json ({"status": "ERROR", "message": "Driver not found!"});
		}
		let preAsso;
		preAsso = await VehicleDriverAssoc.find({
			clientId: req.user.clientId,
			$and:[
				{$or:[{vehicle: req.body.vehicle},{driver: req.body.driver}]},
				{$or:[{ass_date: {$gte: new Date(req.body.ass_date),$lte:new Date(req.body.disass_date)}},
						{disass_date: {$gte: new Date(req.body.ass_date),$lte:new Date(req.body.disass_date)}}
					]}
			]}).lean();
		if(preAsso && preAsso[0]){
			return res.status (200).json ({
				"status": "ERROR",
				"message": `${preAsso[0].driver.name} is already on ${preAsso[0].vehicle && preAsso[0].vehicle.vehicle_reg_no}!
						In this date range!`,
				"data": {}
			});
		}
		preAsso = await VehicleDriverAssoc.find({
			clientId: req.user.clientId,
			$or:[{vehicle: req.body.vehicle},{driver: req.body.driver}],
			$and:[{ass_date: {$lte: new Date(req.body.ass_date)}},{disass_date: {$gte: new Date(req.body.disass_date)}}
			]}).lean();
		if(preAsso && preAsso[0]){
			return res.status (200).json ({
				"status": "ERROR",
				"message": `${preAsso[0].driver.name} is already on ${preAsso[0].vehicle && preAsso[0].vehicle.vehicle_reg_no}!
						In this date range!`,
				"data": {}
			});
		}
		preAsso = await VehicleDriverAssoc.find({
			clientId: req.user.clientId,
		    ass_date: {$lte: new Date(req.body.ass_date)},
			disassociated:false,
			$or:[{vehicle: req.body.vehicle},{driver: req.body.driver}]
		}).lean();
		if(preAsso && preAsso[0]){
			return res.status (200).json ({
				"status": "ERROR",
				"message": `${preAsso[0].driver.name} is already on ${preAsso[0].vehicle && preAsso[0].vehicle.vehicle_reg_no}!
						In this date range!`,
				"data": {}
			});
		}
		let data2save = new VehicleDriverAssoc ({
			"clientId": req.user.clientId,
			"vehicle": vehicle._id,
			"driver": driver._id,
			"disassociated": true,
			"ass_date": req.body.ass_date,
			"disass_date": req.body.disass_date,
			"ass_by": req.user._id,
			"ass_remark": req.body.ass_remark,
			"disass_veh_odo": req.body.disass_veh_odo,
			"ass_veh_odo": req.body.ass_veh_odo,
			"disass_remark": req.body.disass_remark,
		});
		let savedData = await data2save.save();
        // update driver on vehicle from trip advance page also update all trips which lie in given date range
		if(savedData) {
			let aFoundTrip = await Trip.find({
				'clientId': req.body.clientId,
				'vehicle': vehicle._id,
				'advSettled.isCompletelySettled': false,
				'payments.0': {$exists: false},
				'statuses': {
					$elemMatch: {
						'status': 'Trip started',
						'date': {
							$gte: new Date(req.body.ass_date),
							$lte:new Date(req.body.disass_date)
						}
					}
				}
			}, {_id: 1}).lean();

			if (aFoundTrip && aFoundTrip.length) {
				await Trip.updateMany({
					'_id': {$in: otherUtil.arrString2ObjectId(aFoundTrip.map(o => o._id))},
					'clientId': req.body.clientId,
				}, {
					driver: driver._id
				});
			}
		}

		return res.status (200).json ({
			"status": "OK",
			"message": "Vehicle Driver Associated",
			"data": savedData
		});

	}catch (e){
		return res.status (500).json ({
			"status": "ERROR",
			"message": e.toString()
		});
	}
});


router.post('/assistantAssociate',async function (req,res) {
	if (otherUtil.isEmptyObject(req.body)){
		return res.status(500).json({"status":"ERROR","message":"No body found"});
	}
	if (!req.body.vehicle || !req.body.driver){
		return res.status(500).json({"status":"ERROR","message":"Invalid request"});
	}
	try {

		let vehicle = await RegVehicle.find ({clientId: req.user.clientId, _id: req.body.vehicle});
		if (!vehicle || !(vehicle = vehicle[0])) {
			return res.status (500).json ({"status": "ERROR", "message": "Vehicle not found!"});
		}
		let driver = await Driver.find ({clientId: req.user.clientId, _id: req.body.driver, populateVehicle: true});
		if (!driver || !(driver = driver[0])) {
			return res.status (500).json ({"status": "ERROR", "message": "Driver not found!"});
		}
		let preAssoVehicle = await VehicleDriverAssoc.find({
			clientId: req.user.clientId,
			disassociated:false,
			driver:{$exists:false},
			vehicle:req.body.vehicle}).lean();
		let preAssoDriver = await VehicleDriverAssoc.find({
			clientId: req.user.clientId,
			disassociated:false,
			driver2:{$exists:false},
			driver:req.body.driver}).lean();
		let preAssoDriver2 = await VehicleDriverAssoc.find({
			clientId: req.user.clientId,
			disassociated:false,
			driver:{$exists:false},
			driver2:req.body.driver}).lean();
		if(preAssoVehicle && preAssoVehicle[0]){
			return res.status (200).json ({
				"status": "ERROR",
				"message": `${preAssoVehicle[0].driver2.name} is already on ${
					preAssoVehicle[0].vehicle && preAssoVehicle[0].vehicle.vehicle_reg_no
				}!Please disassociate before association!`,
				"data": {}
			});
		}
		else if(preAssoDriver && preAssoDriver[0] || preAssoDriver2 && preAssoDriver2[0]){
			return res.status (200).json ({
				"status": "ERROR",
				"message": `${preAssoDriver[0] && preAssoDriver[0].driver ? preAssoDriver[0].driver.name : preAssoDriver2[0].driver2.name } is already on ${preAssoDriver && preAssoDriver[0] ? preAssoDriver[0].vehicle && preAssoDriver[0].vehicle.vehicle_reg_no :
					preAssoDriver2[0].vehicle && preAssoDriver2[0].vehicle.vehicle_reg_no
				}!Please disassociate before association!`,
				"data": {}
			});
		}

		let data2save = new VehicleDriverAssoc ({
			"clientId": req.user.clientId,
			"vehicle": vehicle._id,
			"driver2": driver._id,
			"ass_date": req.body.ass_date,
			"ass_remark": req.body.ass_remark,
			"ass_gps_odo": vehicle.odometer,
			"ass_veh_odo": req.body.ass_veh_odo,
			"ass_by": req.user._id
		});
		let savedData = await data2save.save();
		if (savedData) {
			await RegVehicle.update({clientId: req.user.clientId, _id: req.body.vehicle},
				{$set:{
						driver2Name:driver.name,
						driver2: driver._id,
					}});
			await Driver.update({clientId: req.user.clientId, _id: req.body.driver},{
				$set: {
					vehicle_assigned_reg_name: vehicle.vehicle_reg_no,
					vehicle_assigned: vehicle._id
				}
			});

		}

		return res.status (200).json ({
			"status": "OK",
			"message": "Vehicle Driver Associated",
			"data": savedData
		});

	}catch (e){
		return res.status (500).json ({
			"status": "ERROR",
			"message": e.toString()
		});
	}
});

router.post('/assistantDisassociate/:_id',async function (req,res,next) {
	if (otherUtil.isEmptyObject(req.body)){
		return res.status(500).json({"status":"ERROR","message":"No body found"});
	}
	if (!req.params || !req.params._id){
		return res.status(500).json({"status":"ERROR","message":"Invalid request"});
	}
	try {
		let assocData = await VehicleDriverAssoc.find ({_id:req.params._id,driver:{$exists:false},});
		if(!assocData || !(assocData = assocData[0])){
			return res.status(500).json({"status":"ERROR","message":"Association detail not found"});
		}
		if(assocData.disassociated && assocData.disassociated === true ){
			return res.status (500).json ({
				"status": "ERROR",
				"message": 'Already disassociated!'
			});
		}

		let data2update = {
			"disass_date": req.body.disass_date || new Date(),
			"disass_remark": req.body.disass_remark,
			"disass_by": req.user._id,
			"disassociated": true
		};
		// assocData.vehicle.odometer && (data2update.disass_gps_odo = assocData.vehicle.odometer);
		// req.body.disass_veh_odo && (data2update.disass_veh_odo = req.body.disass_veh_odo);
		let updatedData = await VehicleDriverAssoc.update ({_id:assocData},{$set:data2update});
		if (updatedData) {
			await RegVehicle.update({_id: assocData.vehicle._id},
				{$unset:{
						driver2:"",
						driver2Name:""
					}});
			await Driver.update({_id: assocData.driver2._id},{
				$unset: {
					vehicle_assigned_reg_name: "",
					vehicle_assigned: ""
				}
			});
			return res.status (200).json ({
				"status": "OK",
				"message": "Vehicle Driver Dis-Associated",
				"data": updatedData
			});

		}
	}catch (e){
		return res.status (500).json ({
			"status": "ERROR",
			"message": e.toString()
		});
	}
});


module.exports = router;
